import React from 'react';
import styles from './css/Login.module.css';

function Login() {
  return (
    <div className={styles.container}>
      <div className={styles.rectangle22} />
      <div className={`${styles.rectangle} ${styles.box1}`} />
      <div className={`${styles.rectangle} ${styles.box2}`} />
      {/* 같은 스타일을 사용하는 다른 박스들도 여기에 추가 */}
      <div className={styles.loginText}>관리자</div>
      <img className={styles.image} src="https://via.placeholder.com/458x471" alt="Placeholder" />
    </div>
  );
}

export default Login;
